(96, 405, 'Cashew Nuts', 'cashew-nuts', 'Cashew nuts are rich in essential fatty acids, potassium, and antioxidants that are beneficial for heart health. It contains phytosterols, phenolic compounds, and oleic acid for heart health and makes blood vessels stronger. Cashew nuts help reduce bad cholesterol (LDL) and improve good cholesterol (HDL) in the body.', '', 1, 87, '2022-07-07 10:38:03', 460, '', '2022-07-15 11:05:48', 460, 0, '0000-00-00 00:00:00', '2022-07-07 10:38:03', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 7, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 1, '*', '', '');
