(83, 328, 'Paprika', 'paprika', 'Paprika is technically native to North and Central America and was used by the indigenous peoples as a food and as a coloring agent. Spanish explorers became enamored with the plant and brought it back to Spain along with tomatoes, potatoes, and other produce. The Spanish – particularly the lower classes, as the heat of paprika was considered undignified by the rich – began using the seeds in food preparation.', '', 1, 87, '2018-01-24 07:20:29', 460, '', '2022-07-15 11:36:07', 460, 0, '0000-00-00 00:00:00', '2018-01-24 07:20:29', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 15, 3, '', '', 1, 10, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(95, 403, 'Black Seed Oil', 'black-seed-oil', 'Black seed oil is high in antioxidants and may have several benefits for health. These include the treatment of asthma and various skin conditions, lowering blood sugar and cholesterol levels, aiding in weight loss, and protecting brain health.', '', 1, 87, '2022-07-07 10:35:04', 460, '', '2022-07-15 11:07:00', 460, 0, '0000-00-00 00:00:00', '2022-07-07 10:35:04', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(84, 329, 'Rosemary', 'black-orange-tee', 'The slender leaves (they aren’t actually needles) can often be sticky with resin and are very assertive in flavor. Dried rosemary leaves must be used with a careful hand as it can dominate a dish. The dried rosemary sprigs are added to rubs and marinades, stuffed into chickens, or tied to meats about to be used on the grill. Even the branches have culinary uses – de-leaved sticks of rosemary make for excellent kabobs and a bunch of rosemary can be tied together to form a basting brush.', '', 1, 88, '2017-09-28 07:20:29', 460, '', '2022-07-15 11:34:49', 460, 0, '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 11, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(89, 394, 'Black Pepper', 'black-pepper', 'Black pepper is used as a spice in nearly all the world’s cuisines as a pungent, spicy, heating agent for food due to the presence of capsaicin and piperine. Teasings of citrus and wood also add to the hickory smoked black pepper’s allure. Smoked black peppercorns can be used whole in stews, soups, stocks, and pickles.', '', 1, 90, '2022-07-02 10:30:10', 460, '', '2022-07-15 11:22:40', 460, 0, '0000-00-00 00:00:00', '2022-07-02 10:30:10', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(85, 330, 'Hibiscus', 'uncasual-trendy', 'Hibiscus flowers are sort of a miracle plant. The leaves are used to make healing compounds. The seeds have diuretic properties. The fibrous stems are used to make burlap. And the sepals – the fleshy part that holds the flower – are used for food coloring and for tisanes.', '', 1, 87, '2018-02-08 07:20:29', 460, '', '2022-07-15 11:34:09', 460, 0, '0000-00-00 00:00:00', '2018-02-08 07:20:29', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(90, 395, 'Ginseng', 'ginseng', 'Ginseng enhances sexual performance, improves male fertility through modulating the neuronal and hormonal systems, promotes spermatogenesis, and acts directly on sperms via steroid receptors. Ginseng also preserves male fertility during disease states.', '', 1, 89, '2022-07-02 10:35:20', 460, '', '2022-07-15 11:21:47', 460, 0, '0000-00-00 00:00:00', '2022-07-02 10:35:20', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(86, 331, 'Oregano', 'oregano', 'Used primarily in Greek, Italian, Spanish, Mexican and Tex-mex cuisine, oregano lends a peppery, herbal bite to foods. When fresh, it’s used as a finishing spice, whereas dried it’s used at the beginning of cooking to build layers of flavor.', '', 1, 88, '2018-01-23 07:20:29', 460, '', '2022-07-15 11:33:22', 460, 0, '0000-00-00 00:00:00', '2018-01-23 07:20:29', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 10, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(91, 396, 'Chicken Masala', 'chicken-masala', 'Dry roast coriander seeds, cumin seeds, black peppercorns, Kashmiri red chilies, black cardamoms, green cardamoms, cinnamon stick, and cloves on low heat until lightly browned and fragrant (8-10 minutes).', '', 1, 90, '2022-07-02 10:52:25', 460, '', '2022-07-15 11:19:22', 460, 0, '0000-00-00 00:00:00', '2022-07-02 10:52:25', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
