(92, 397, 'Garam Masala', 'garam-masala', '“Garam” is the “hot” in “hot spice blend,” though this refers to the pungency of the mixture as opposed to the heat from cayenne pepper. Bitter, hot spices such as black pepper, black cardamom, cloves, turmeric, cinnamon and cumin make up the bulk of the garam masala spice mix.', '', 1, 90, '2022-07-02 10:54:29', 460, '', '2022-07-15 11:11:37', 460, 0, '0000-00-00 00:00:00', '2022-07-02 10:54:29', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 4, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(88, 393, 'Maca Root', 'maca-root', 'Maca is an ingredient that has been extensively studied for its potent health-promoting properties.It’s also a common supplement used to boost libido, mood, and energy levels.Additionally, many people claim that maca root can help improve body composition and enhance curviness.', '', 1, 89, '2022-07-02 10:15:46', 460, '', '2022-07-15 11:28:48', 460, 0, '0000-00-00 00:00:00', '2022-07-02 10:15:46', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 1, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 1, '*', '', ''),
