(94, 402, 'Maca Root Powder', 'maca-root-powder', 'Maca is a native Peruvian root vegetable that has been used for centuries to promote health and balance hormone levels, helping women with conditions like PMS, PCOS and oestrogen dominance, as well as improve fertility, libido and stress management.', '', 1, 89, '2022-07-07 10:32:38', 460, '', '2022-07-15 11:08:43', 460, 0, '0000-00-00 00:00:00', '2022-07-07 10:32:38', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(97, 406, 'Groundnuts', 'groundnuts', 'Groundnuts are abundant in protein, healthy fats and dietary fibre. Groundnuts are immensely rich in potassium, calcium, phosphorus and B vitamins which offers you with a host of health benefits. Groundnuts are a great blend of healthy fats, protein and fibre that curbs your appetite, lowers the risk of heart disease and regulates blood glucose levels.', '', 1, 87, '2022-07-07 10:39:06', 460, '', '2022-07-15 11:04:16', 460, 0, '0000-00-00 00:00:00', '2022-07-07 10:39:06', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 7, 0, '', '', 1, 6, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(98, 407, 'Sage', 'sage', 'Sage has a sweet, but herbaceous and very savory flavor that’s reminiscent of celery, eucalyptus, parsley, and a bit of pine.', '', 1, 88, '2022-07-07 11:00:17', 460, '', '2022-07-15 11:00:46', 460, 0, '0000-00-00 00:00:00', '2022-07-07 11:00:17', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(99, 408, 'Chilli Flakes', 'chilli-flakes', 'chili flakes in a spare shaker at the table. Perfect for finishing off pizza, mashed potatoes, for giving a bit of kick to soups.', '', 1, 90, '2022-07-07 11:03:26', 460, '', '2022-07-15 10:58:53', 460, 0, '0000-00-00 00:00:00', '2022-07-07 11:03:26', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(100, 409, 'About Us', 'about-us', '<p>\r\n  <strong>WHO ARE WE?</strong>\r\n  <br />\r\n  Pio Spices E.A Ltd. was established in 2015 with one barnch in eastleigh, Nairobi, Kenya. We have sinced opened a second branch in Kampala, Uganda. We thrive in giving the best quality spices and herbs. Our customer experience is unmatched in the industry. TRY US TODAY!.   \r\n  \r\n</p>\r\n\r\n\r\n<p>\r\n                     <Strong> OUR MISSION</Strong> \r\n<br />\r\n					\r\n                       To offer quality spices, herbs and nuts to our customers at an affordable price. \r\n</p>\r\n\r\n  \r\n\r\n					<p>\r\n                     <strong>OUR VISION</strong> \r\n                      <br />\r\n                      To be the best spices and herbs supplier in East and Central Africa.\r\n</p>\r\n<br />\r\n\r\n<p>\r\n  <Strong> OUR C.E.O / FOUNDER </Strong>\r\n  <br />\r\n  Mr. Dennis Mbai is the founder and the current C.E.O of the company.\r\n  \r\n  <img src=\"images/denno.jpg\" style=\"max-width:40%;\" />\r\n  \r\n</p>\r\n\r\n\r\n', '', 1, 14, '2022-07-09 08:37:38', 460, '', '2022-07-09 10:37:28', 460, 460, '2022-07-09 10:37:28', '2022-07-09 08:37:38', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"_:default\",\"show_title\":\"0\",\"link_titles\":\"0\",\"show_tags\":\"0\",\"show_intro\":\"0\",\"info_block_position\":\"\",\"info_block_show_title\":\"0\",\"show_category\":\"0\",\"link_category\":\"\",\"show_parent_category\":\"0\",\"link_parent_category\":\"\",\"show_associations\":\"0\",\"show_author\":\"0\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 21, 2, '', '', 1, 57, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(101, 410, 'Contacts', 'contacts', '<a href=\"index.php?option=com_contact&view=contact&id=1&catid=11\">Dennis Mbai</a>\r\n<a href=\"index.php?option=com_contact&view=contact&id=1&catid=11\"></a>', '', 1, 14, '2022-07-09 09:32:52', 460, '', '2022-07-09 09:35:11', 460, 0, '0000-00-00 00:00:00', '2022-07-09 09:32:52', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 1, '', '', 1, 5, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(102, 411, 'Bay Leaves', 'bay-leaves', 't’s hard to pin down the flavor of a bay leaf. Indeed, for one of the most widely used herbs in sauces, soups, and stews you might be hard pressed to accurately describe the flavor since the leaves release it so slowly. If you’re really curious then place a few of these whole bay leaves in a bowl and pour boiling water over it and inhale deeply.\r\n\r\nBitter. Camphor. Mace. A bit a eucalyptus.', '', 1, 88, '2022-07-15 10:22:14', 460, '', '2022-07-15 11:31:01', 460, 0, '0000-00-00 00:00:00', '2022-07-15 10:22:14', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(103, 412, 'Parsley', 'parsley', 'Parsley as an ingredient brings a needed bitter flavor to food that people often forget to add. If you ever eat a dish and feel it’s missing something then parsley is usually the remedy.', '', 1, 88, '2022-07-15 10:27:15', 460, '', '2022-07-15 10:56:33', 460, 0, '0000-00-00 00:00:00', '2022-07-15 10:27:15', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(104, 413, 'Cumin Seeds', 'cumin-seeds', 'cumin seeds offer all the buttery and earthy richness one wants from a cumin seed. Lightly toasting the seed in a dry skillet over medium heat will release the oils and allow the aromas and flavors to bloom. Afterward, use whole or mill in a spice grinder.', '', 1, 90, '2022-07-15 10:29:37', 460, '', '2022-07-15 10:55:04', 460, 0, '0000-00-00 00:00:00', '2022-07-15 10:29:37', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(105, 414, 'Tumeric', 'tumeric', 'Ground turmeric powder imbues food with a peculiar flavor unique to turmeric. As a member of the ginger family it possesses a distinct gingery-ness that’s often described and woody, musky, and floral. The naturally occurring compound curcumin also lends a certain mustard flavor to this ground turmeric powder.', '', 1, 90, '2022-07-15 10:35:26', 460, '', '2022-07-15 10:37:53', 460, 0, '0000-00-00 00:00:00', '2022-07-15 10:35:26', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(106, 415, 'Cloves Whole', 'cloves-whole', 'The clove also has a history of medical use. Their essential oils have the ability to assist digestion by increasing stomach acid, relax muscles in the body, and whole dried clove buds work as oral painkillers (pop one in your mouth next to a sore tooth).', '', 1, 90, '2022-07-15 10:48:56', 460, '', '2022-07-15 10:53:26', 460, 0, '0000-00-00 00:00:00', '2022-07-15 10:48:56', '0000-00-00 00:00:00', '{}', '{}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');
