(42, 'index.php?option=com_k2&view=item&id=89', 'index.php?option=com_k2&view=item&id=89:modern-and-minimalist-flat-interior-design', 'Modern and Minimalist Flat Interior Design', ' The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary. The languages only differ in their grammar, their pronunciation and their most common words. as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family. Their separate existence is a myth ', '2022-07-02 11:58:46', '38bbb2c725eff8766ace690d96a2436a', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, ),
(43, 'index.php?option=com_k2&view=item&id=88', 'index.php?option=com_k2&view=item&id=88:living-rooms-show-range-of-modernist-to-traditional', 'Living Rooms Show Range of Modernist to Traditional', ' The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary. The languages only differ in their grammar, their pronunciation and their most common words. as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family. Their separate existence is a myth ', '2022-07-02 11:58:46', '58c8f4a06483d55a95b1b39d9d7d037e', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, );
INSERT INTO `yr3mp_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(44, 'index.php?option=com_k2&view=item&id=87', 'index.php?option=com_k2&view=item&id=87:using-joomla', 'Using Joomla!', ' With Joomla! You can create anything from a simple personal website to a complex ecommerce or social site with millions of visitors. This section of the sample data provides you with a brief introduction to Joomla! concepts and reference material to help you understand how Joomla! works. When you no longer need the sample data, you can can simply unpublish the sample data category found within each extension in the site administrator or you may completely delete each item and all of the categories. ', '2022-07-02 11:58:46', 'fb39eed06baf5735aa35b8bbb98998d4', 1, 0, 1, '*', '2017-09-26 07:20:29', '0000-00-00 00:00:00', '2017-09-26 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, ),
(45, 'index.php?option=com_k2&view=item&id=86', 'index.php?option=com_k2&view=item&id=86:the-joomla-project', 'The Joomla! Project', ' The Joomla! Project consists of all of the people who make and support the Joomla! Web Platform and Content Management System. Our mission is to provide a flexible platform for digital publishing and collaboration. The core values are: Freedom Equality Trust Community Collaboration Usability In our vision, we see: People publishing and collaborating in their communities and around the world Software that is free, secure, and high-quality A community that is enjoyable and rewarding to participate in People around the world using their preferred languages A project that acts autonomously A project that is socially responsible A project dedicated to maintaining the trust of its users There are millions of users around the world and thousands of people who contribute to the Joomla! Project. They work in three main groups: the Production Working Group, responsible for everything that goes into software and documentation; the Community Working Group, responsible for creating a nurturing the community; and Open Source Matters, the non profit organization responsible for managing legal, financial and organizational issues. Joomla! is a free and open source project, which uses the GNU General Public License version 2 or later. ', '2022-07-02 11:58:46', '2cbcbb05d642221ddaa47f92fde6ae11', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, );
INSERT INTO `yr3mp_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(46, 'index.php?option=com_k2&view=item&id=85', 'index.php?option=com_k2&view=item&id=85:the-joomla-community', 'The Joomla! Community', ' Joomla! means All Together, and it is a community of people all working and having fun together that makes Joomla! possible. Thousands of people each year participate in the Joomla! community, and we hope you will be one of them. People with all kinds of skills, of all skill levels and from around the world are welcome to join in. Participate in the Joomla.org family of websites (the forum is a great place to start). Come to a Joomla! event . Join or start a Joomla! Users Group . Whether you are a developer, site administrator, designer, end user or fan, there are ways for you to participate and contribute. ', '2022-07-02 11:58:47', '3f8cecfc5accbc676f0b80f2d44294ca', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, ),
(47, 'index.php?option=com_k2&view=item&id=84', 'index.php?option=com_k2&view=item&id=84:getting-started', 'Getting Started', ' It\'s easy to get started creating your website. Knowing some of the basics will help. What is a Content Management System? A content management system is software that allows you to create and manage webpages easily by separating the creation of your content from the mechanics required to present it on the web. In this site, the content is stored in a database . The look and feel are created by a template . The Joomla! software brings together the template and the content to create web pages. Site and Administrator Your site actually has two separate sites. The site (also called the front end) is what visitors to your site will see. The administrator (also called the back end) is only used by people managing your site. You can access the administrator by clicking the \"Site Administrator\" link on the \"This Site\" menu or by adding /administrator to the end of you domain name. Log in to the administrator using the username and password created during the installation of Joomla!. Logging in To login to the front end of your site use the login form or the login menu link on the \"This Site\" menu. Use the user name an password that were created as part of the installation process. Once logged in you will be able to create and edit articles. In managing your site, you will be able to create content that only logged in users are able to see. Creating an article Once you are logged in, a new menu will be visible. To create a new article, click on the \"submit article\" link on that menu. The new article interface gives you a lot of options, but all you need to do is add a title an put something in the content area. To make it easy to find, set the state to published an put it in the Joomla! category. You can edit an existing article by clicking on the edit icon (this only displays to users who have the right to edit). Learn more There is much more to learn about how to use Joomla! to create the web site you envision. You can learn much more at the Joomla! documentation site and on the Joomla! forums. ', '2022-07-02 11:58:47', '16232b7dd778401bc532c31bec457a38', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, );
