(49, 'index.php?option=com_k2&view=item&id=82', 'index.php?option=com_k2&view=item&id=82:what-s-new-in-1-5', 'What\'s New in 1.5?', ' This article deliberately archived as an example. As with previous releases, Joomla! provides a unified and easy-to-use framework for delivering content for Web sites of all kinds. To support the changing nature of the Internet and emerging Web technologies, Joomla! required substantial restructuring of its core functionality and we also used this effort to simplify many challenges within the current user interface. Joomla! 1.5 has many new features. In Joomla! 1.5, you\'\'ll notice: Substantially improved usability, manageability, and scalability far beyond the original Mambo foundations Expanded accessibility to support internationalisation, double-byte characters and right-to-left support for Arabic, Farsi, and Hebrew languages among others Extended integration of external applications through Web services Enhanced content delivery, template and presentation capabilities to support accessibility standards and content delivery to any destination A more sustainable and flexible framework for Component and Extension developers Backward compatibility with previous releases of Components, Templates, Modules, and other Extensions ', '2022-07-02 11:58:47', 'eb3466b7c6cc70d3b9c58231f5685003', 1, 0, 1, '*', '2017-09-28 07:20:29', '0000-00-00 00:00:00', '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 0, 1, ),
