(120, 'Living Rooms Show Range of Modernist to Traditional', 'living-rooms-show-range-of-modernist-to-traditional', 105, 1, '<p><img src=\"images/sampledata/sample1.jpg\" border=\"0\" alt=\"\" width=\"630\" height=\"472\" /></p>\r\n<p>The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary. The languages only differ in their grammar, their pronunciation and their most common words. as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family. Their separate existence is a myth</p>\r\n', '\r\n<p>Everyone realizes why a new common language would be desirable: one could refuse to pay expensive translators. To achieve this, it would be necessary to have uniform grammar, pronunciation and more common words.</p>\r\n<p>If several languages coalesce, the grammar of the resulting language is more simple and regular than that of the individual languages. The new common language will be more simple and regular than the existing European languages. It will be as simple as Occidental; in fact, it will be Occidental.</p>\r\n<p>To an English person, it will seem like simplified English, as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary.</p>\r\n<p>The languages only differ in their grammar, their pronunciation and their most common words. Everyone realizes why a new common language would be desirable: one could refuse to pay expensive translators. To</p>', NULL, NULL, NULL, '', '2017-09-28 07:20:29', 460, '', 0, '0000-00-00 00:00:00', '2018-02-08 16:47:59', 460, '2017-09-28 07:20:29', '0000-00-00 00:00:00', 0, 1, 1, 0, 0, '', '', '', '', 31, '{\"catItemTitle\":\"\",\"catItemTitleLinked\":\"\",\"catItemFeaturedNotice\":\"\",\"catItemAuthor\":\"\",\"catItem